import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

function Myinfo(){
  return(
    <div>
    <h1>Tejas</h1>
    <p>Hi I am A Webdeveloper</p>
    </div>
  )
}

ReactDOM.render(
  <Myinfo/>,document.getElementById('root')
);

serviceWorker.unregister();
